import {
  Box,
  Heading,
  HStack,
  SimpleGrid,
  Spacer,
  Text,
} from "@chakra-ui/react";

export const MenuNav = ({children}) => {
  return (
    <Box
      position="sticky"
      top="0"
      as="nav"
      w="100%"
      bg="rgba(255,255,255,0.6)"
      css={{ backdropFilter: "blur(10px)" }}
      zIndex={1}
    >
      <div>
        <SimpleGrid columns={[1,3]}>

          <Box p="2">
            <HStack p="2" spacing={5}>
              <Heading fontSize={25} letterSpacing={"tighter"}>
                La Voluntad
              </Heading>

              <Text fontSize={20}> |  Carta </Text>
            </HStack>
          </Box>

          <Spacer/>


          <SimpleGrid spacing="3" columns={2} p="2" maxW={"400px"}>
              {children}
          </SimpleGrid>
        </SimpleGrid>
      </div>
    </Box>
  );
};
